import './App.css';
import React, {  useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import AddWilling from './components/AddWilling';
import FindWilling from './components/FindWilling';
import AllWilling from './components/AllWilling';
import Home from './components/Home';

function App() {
  const [wiling, setWiling] = useState({})


  const saveWillingDetails = ( n, l, t) => {
    let newWilling = { name: n, location: l, tWilling: t }
    // setUser([...user,newUser])
    setWiling(newWilling)
  }



  return (
    <div className="App">
    <Router>
         <Routes>
            <Route path='/' element ={<Home/>}/>
            <Route path='/add' element ={<AddWilling saveWillingDetails = {saveWillingDetails} />}/>
            <Route path='/find' element ={<FindWilling/>}/>
            <Route path='/all' element ={<AllWilling/>}/>
         </Routes> 
      </Router>
    </div>
  );
}

export default App;
